import React,{Component} from 'react';  
// import popup  from 'reactjs-popup'
// import Popup from 'reactjs-popup';

import * as ReactBootStrap from 'react-bootstrap'

export default class Result extends Component{
    render() {
      var ModalDialogBox = ReactBootStrap.Modal;
        return (
      
          <ModalDialogBox show= {true} >
            <ModalDialogBox.Header closeButton>
              <ModalDialogBox.Title id="contained-modal-title">Result</ModalDialogBox.Title>
            </ModalDialogBox.Header>
            <ModalDialogBox.Body>
            
            </ModalDialogBox.Body>
            <ModalDialogBox.Footer>
              
            </ModalDialogBox.Footer>
          </ModalDialogBox>
      
        );
      }
}
